static void MWDSPCG_FFT_DblLen_Z(creal_T y[], int nChans, int nRows, const
  double twiddleTable[], int twiddleStep)
{
  int N2;
  int N4;
  int W4;
  int yIdx;
  int tempOut0Re_tmp;
  double tempOut0Re;
  double accRe;
  double tempOut0Im;
  int cTemp_re_tmp;
  int k;
  int ix;
  int accRe_tmp;
  double tempOut1Re;
  double y_re;
  double y_im;

  /* In-place "double-length" data recovery
     Table-based mem-optimized twiddle computation

     Used to recover linear-ordered length-N point complex FFT result
     from a linear-ordered complex length-N/2 point FFT, performed
     on N interleaved real values.
   */
  N2 = nRows >> 1;
  N4 = N2 >> 1;
  W4 = N4 * twiddleStep;
  yIdx = nRows * (nChans - 1);
  if (nRows > 2) {
    tempOut0Re_tmp = N4 + yIdx;
    tempOut0Re = y[tempOut0Re_tmp].re;
    tempOut0Im = y[tempOut0Re_tmp].im;
    cTemp_re_tmp = (N2 + N4) + yIdx;
    y[cTemp_re_tmp].re = tempOut0Re;
    y[cTemp_re_tmp].im = tempOut0Im;
    y[tempOut0Re_tmp].re = tempOut0Re;
    y[tempOut0Re_tmp].im = -tempOut0Im;
  }

  if (nRows > 1) {
    accRe = y[yIdx].re;
    accRe -= y[yIdx].im;
    cTemp_re_tmp = N2 + yIdx;
    y[cTemp_re_tmp].re = accRe;
    y[cTemp_re_tmp].im = 0.0;
  }

  accRe = y[yIdx].re;
  accRe += y[yIdx].im;
  y[yIdx].re = accRe;
  y[yIdx].im = 0.0;
  k = twiddleStep;
  for (ix = 1; ix < N4; ix++) {
    tempOut0Re_tmp = ix + yIdx;
    accRe = y[tempOut0Re_tmp].re;
    accRe_tmp = (N2 - ix) + yIdx;
    accRe += y[accRe_tmp].re;
    tempOut0Re = accRe / 2.0;
    accRe = y[tempOut0Re_tmp].im;
    accRe -= y[accRe_tmp].im;
    tempOut0Im = accRe / 2.0;
    accRe = y[tempOut0Re_tmp].im;
    accRe += y[accRe_tmp].im;
    tempOut1Re = accRe / 2.0;
    accRe = y[accRe_tmp].re;
    accRe -= y[tempOut0Re_tmp].re;
    accRe /= 2.0;
    y[tempOut0Re_tmp].re = tempOut1Re;
    y[tempOut0Re_tmp].im = accRe;
    cTemp_re_tmp = W4 - k;
    accRe = twiddleTable[k] * y[tempOut0Re_tmp].re - -twiddleTable[cTemp_re_tmp]
      * y[tempOut0Re_tmp].im;
    tempOut1Re = twiddleTable[k] * y[tempOut0Re_tmp].im +
      -twiddleTable[cTemp_re_tmp] * y[tempOut0Re_tmp].re;
    y[tempOut0Re_tmp].re = tempOut0Re + accRe;
    y[tempOut0Re_tmp].im = tempOut0Im + tempOut1Re;
    y_re = y[tempOut0Re_tmp].re;
    y_im = y[tempOut0Re_tmp].im;
    cTemp_re_tmp = (nRows - ix) + yIdx;
    y[cTemp_re_tmp].re = y_re;
    y[cTemp_re_tmp].im = -y_im;
    cTemp_re_tmp = (N2 + ix) + yIdx;
    y[cTemp_re_tmp].re = tempOut0Re - accRe;
    y[cTemp_re_tmp].im = tempOut0Im - tempOut1Re;
    y_re = y[cTemp_re_tmp].re;
    y_im = y[cTemp_re_tmp].im;
    y[accRe_tmp].re = y_re;
    y[accRe_tmp].im = -y_im;
    k += twiddleStep;
  }
}

static void MWDSPCG_FFT_Interleave_R2BR_D(const double x[], creal_T y[], int
  nChans, int nRows)
{
  int br_j;
  int yIdx;
  int uIdx;
  int nChansBy2;
  int j;
  int j_tmp;
  int bit_fftLen;

  /* Bit-reverses the input data simultaneously with the interleaving operation,
     obviating the need for explicit data reordering later.  This requires an
     FFT with bit-reversed inputs.
   */
  br_j = 0;
  yIdx = 0;
  uIdx = 0;
  for (nChansBy2 = nChans >> 1; nChansBy2 != 0; nChansBy2--) {
    for (j = nRows - 1; j > 0; j--) {
      y[yIdx + br_j].re = x[uIdx];
      y[yIdx + br_j].im = x[uIdx + nRows];
      uIdx++;

      /* Compute next bit-reversed destination index */
      bit_fftLen = nRows;
      do {
        bit_fftLen = (int)((unsigned int)bit_fftLen >> 1);
        br_j ^= bit_fftLen;
      } while ((br_j & bit_fftLen) == 0);
    }

    br_j += yIdx;
    y[br_j].re = x[uIdx];
    j_tmp = uIdx + nRows;
    y[br_j].im = x[j_tmp];
    uIdx = j_tmp + 1;
    yIdx += nRows << 1;
    br_j = 0;
  }

  /* For an odd number of channels, prepare the last channel
     for a double-length real signal algorithm.  No actual
     interleaving is required, just a copy of the last column
     of real data, but now placed in bit-reversed order.
     We need to cast the real u pointer to a cDType_T pointer,
     in order to fake the interleaving, and cut the number
     of elements in half (half as many complex interleaved
     elements as compared to real non-interleaved elements).
   */
  if ((nChans & 1) != 0) {
    j_tmp = nRows >> 1;
    for (j = j_tmp - 1; j > 0; j--) {
      y[yIdx + br_j].re = x[uIdx];
      y[yIdx + br_j].im = x[uIdx + 1];
      uIdx += 2;

      /* Compute next bit-reversed destination index */
      bit_fftLen = j_tmp;
      do {
        bit_fftLen = (int)((unsigned int)bit_fftLen >> 1);
        br_j ^= bit_fftLen;
      } while ((br_j & bit_fftLen) == 0);
    }

    br_j += yIdx;
    y[br_j].re = x[uIdx];
    y[br_j].im = x[uIdx + 1];
  }
}

